import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import DateTime from './componants/date-time/DateTime';
import Covid from './componants/covid-updates/Covid';


function App() {
  return (
    <>
      <DateTime />
      <div className="text-center">
        <h1 className="text-uppercase">Covid-19 Tracker</h1>

        <select class="form-control" id="exampleFormControlSelect1">
          <option>1</option>
          <option>2</option>
          <option>3</option>
          <option>4</option>
          <option>5</option>
        </select>


        <br />
        <br />
        <Covid />
      </div>
    </>
  );
}

export default App;
